import Header from "./Header";
import Main from "./Main";
function App() {
  useEffect(() => {
    fetch("http://localhost:9000/questions").then((res) => res.json());
  }, []);
  return (
    <div className='app'>
      <Header />
      <Main>
        <p>15</p>
        <p>questions</p>
      </Main>
    </div>
  );
}

export default App;
